import react from "react";
import {Link} from "react-router-dom";

const Navbar = () => {
    const handleChangeSelection = (value) => {
        console.log(value);
        window.location.href = String("/" + value);
    }
    return (
        <nav className="navbar-expand">
            <div className="navbar nav1 bg-dark">
                <div className="navbar bg-dark">
                    <ul className="navbar-nav mr-auto">
                        <li>
                            <Link to="/home" className="navbar-brand"><h1 className="h1">homepage</h1></Link>
                        </li>
                        <li>
                            <Link to="/signin" className="navbar-brand"><h1 className="h1">Sign in</h1></Link>
                        </li>
                        <div className="dropdown">
                            <li className="nav-item bg-dark dropdown">
                                <select className="bg-dark navbar-brand" onChange={event => handleChangeSelection(event.target.value)}>
                                    <option className="options" value="">Select</option>
                                    <option className="options" value="signin">Sign in</option>
                                    <option className="options" value="home">Home</option>
                                    <option className="options" value="reeses">Reeses</option>
                                </select>
                            </li>
                        </div>
                    </ul>
                </div>
            </div>
        </nav>
    )
}

export default Navbar;
